import React, { Component } from "react";
import setSelect2 from "../assets/js/setSelect2";
import { connect } from "react-redux";
import Extrato from "./ExtratoAdmin";
import GridCards from "./GridCards";
import {fetchUserCount, fetchUserSites} from "../actions/usersActions";
import {fetchViewCount} from "../actions/viewsActions";
import { fetchExtratoAbstract } from "../actions/extratoActions";
import Select from 'react-select';

import $ from "jquery";

class Dashboard extends Component {

    componentDidMount(){
        // setSelect2();
        this.props.fetchUserCount();
        this.props.fetchViewCount();
        this.props.fetchUserSites();
        this.props.fetchExtratoAbstract(null, null, null, null, null, null, 1, 1);
    }

    change = () => {
        let periodo = $( "#filter-date" ).val();
        this.props.fetchUserCount( periodo );
        this.props.fetchExtratoAbstract( null, null, null, null, null, null, 1, parseInt( periodo ) );
    }

    filter = () => {
        var search         = $( '#nome-usuario' ).val();
        var date_start     = $( '#inicio-periodo' ).val();
        var date_end       = $( '#fim-periodo' ).val();
        var payment_type   = $( '#select2-tipo-pagamento-container' ).val();
        var payment_method = $( '#select2-forma-pagamento-container' ).val();
        var status         = $( '#status' ).val();
        var periodo        = $("#filter-date").val();

        search     = '' === search ? null : search;
        date_start = '' === date_start ? null : date_start;
        date_end   = '' === date_end ? null : date_end;

        this.props.fetchExtratoAbstract( search, date_start, date_end, payment_type, payment_method, status, 1, parseInt( periodo ) );
        this.setState({
            page: 2
        })
    }


    render() {
        const {total, totalPassado, loading, error, porcentagem, totalSites, totalSitePassado, porcentagemSites} = this.props.usersCount;
        console.log(totalSites)
        const loadingExtrato = this.props.extrato.loading;
        const {extrato} = this.props.extrato;
        const {dashboard} = extrato;
        const {extratoOld} = this.props.extrato;
        const extratoAbstract = this.props.extratoAbstract;
        var totalOld;

        console.log( this.props.views );
        var views = 0;
        var viewsPassado = 0;
        var porcentagemViews = 0;

        if ( undefined !== this.props.views ) {
            views = this.props.views.total;
            viewsPassado = this.props.views.totalPassado;
            porcentagemViews = parseFloat(views*(viewsPassado/100));
        }

        // console.log(extratoOld)

        if(extratoOld){
            totalOld = extratoOld.dashboard.total
        }


        var faturamento;
        var recebido;
        if(extratoAbstract){
            faturamento = extratoAbstract.dashboard.total.toFixed(2).replace(".", ",")
            recebido = extratoAbstract.dashboard.netgift.recebido.toFixed(2).replace(".", ",")
        }else{
            faturamento = "--"
            recebido = "--"
        }

        return (
            <div className="wrap-content home">
                <div className="content-title">
                    <div className="flex flex-baseline flex-space">
                        <div>
                            <h1>Dashboard</h1>
                            <h2>Você está no painel principal</h2>
                        </div>
                        <div className="filter-admin">
                            <Select
                                onChange={() => this.change()}
                                options={[
                                    {value: 1, label: 'Diário'},
                                    {value: 7, label: 'Semanal'},
                                    {value: 30, label: 'Mensal'},
                                ]}
                                isSearchable={false}
                                id="filter-date"
                                className="select-filter-admin select-filter-date"
                                name="filter_date"
                                closeMenuOnSelect={true}
                                placeholder="Diário"
                                noOptionsMessage={() => { return "Tipo não encontrado." }}
                            />
                        </div>
                    </div>
                </div>
                <div className="wrap-body">
                    <GridCards 
                        totalUser={total}
                        totalUserPassado={totalPassado}
                        porcentagem={porcentagem ? porcentagem : "--"}
                        totalSites={totalSites ? totalSites : "--"}
                        totalSitePassado={totalSitePassado ? totalSitePassado : "--"}
                        porcentagemSites={porcentagemSites ? porcentagemSites : "--"}
                        loading={loading}
                        faturamento={dashboard ? faturamento : "--"}
                        recebido={dashboard ? recebido : "--"}
                        totalOld={totalOld ? totalOld : "--"}
                        views={views}
                        viewsPassado={viewsPassado}
                        porcentagemViews={porcentagemViews}
                    />
                </div>
                <Extrato />
            </div>
        )
    }
}
const mapStateToProps = state => ({
    extrato: state.extrato,
    usersCount: state.usersCount,
    extrato: state.extrato,
    extratoAbstract : state.extrato.extratoAbstract,
    views : state.viewsCount
  })

export default connect(mapStateToProps, {fetchUserCount, fetchUserSites, fetchExtratoAbstract, fetchViewCount})(Dashboard);
